(14047, '_transient_dash_88ae138922fe95674369b1cb3d215a2b', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wordpress.org/news/2016/10/join-us-again-for-global-wordpress-translation-day/''>Join Us Again for Global WordPress Translation Day</a> <span class="rss-date">October 14, 2016</span><div class="rssSummary">The WordPress Polyglots team is organizing the second Global WordPress Translation Day on November 12th. Everyone is invited to join – from anywhere in the world! Translating is one of the easiest ways to get involved with WordPress and contribute to the project. Global WordPress Translation Day is your chance to learn more about translating WordPress, meet [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wptavern.com/the-challenges-of-organizing-a-wordcamp-from-abroad''>WPTavern: The Challenges of Organizing a WordCamp From Abroad</a></li><li><a class=''rsswidget'' href=''https://wptavern.com/controversy-surrounding-wordpress-org-popular-themes-exposes-weaknesses-in-the-algorithm''>WPTavern: Controversy Surrounding WordPress.org “Popular” Themes Exposes Weaknesses in the Algorithm</a></li><li><a class=''rsswidget'' href=''https://wptavern.com/weglot-multilingual-wordpress-plugin-passes-e10000-in-monthly-revenue''>WPTavern: Weglot Multilingual WordPress Plugin Passes €10,000 in Monthly Revenue</a></li></ul></div><div class="rss-widget"><ul><li class="dashboard-news-plugin"><span>Popular Plugin:</span> Meta Slider&nbsp;<a href="plugin-install.php?tab=plugin-information&amp;plugin=google-analytics-dashboard-for-wp&amp;_wpnonce=e3078f0fdf&amp;TB_iframe=true&amp;width=600&amp;height=800" class="thickbox open-plugin-details-modal" aria-label="Install Meta Slider">(Install)</a></li></ul></div>', 'no'),
